// Check if notes page loaded properly
notesPage.isNotesPageLoaded().then(function (isLoaded) {
    if (!isLoaded) {
        cy.log('Notes page not loaded properly, skipping test');
        notesPage.takeScreenshot('notes-not-loaded');
        return;
    }
    // Check if add note button is available
    notesPage.isAddNoteButtonAvailable().then(function (isAvailable) {
        if (!isAvailable) {
            cy.log('Add note button not available, skipping test');
            return;
        }
        // Create a new note
        notesPage.clickAddNote();
        var noteTitle = "Test Note ".concat(Date.now());
        notesPage.fillNoteForm({
            title: noteTitle,
            content: 'This is a test note created by Cypress',
            tags: ['test', 'cypress']
        });
        notesPage.submitNoteForm();
        cy.wait('@createNote');
        notesPage.verifySuccessNotification();
        notesPage.noteExists(noteTitle).then(function (exists) {
            cy.wrap(exists).should('be.true');
        });
        // Filter by tag
        notesPage.filterByTag('test');
        cy.wait('@getNotes');
        notesPage.noteExists(noteTitle).then(function (exists) {
            cy.wrap(exists).should('be.true');
        });
        // Search for note
        notesPage.searchNotes(noteTitle);
        cy.wait('@getNotes');
        notesPage.noteExists(noteTitle).then(function (exists) {
            cy.wrap(exists).should('be.true');
        });
        // Delete note
        notesPage.deleteNote(noteTitle);
        cy.wait('@deleteNote');
        notesPage.verifySuccessNotification();
        notesPage.noteExists(noteTitle).then(function (exists) {
            cy.wrap(exists).should('be.false');
        });
    });
});

// Check if notes page loaded properly
notesPage.isNotesPageLoaded().then(function (isLoaded) {
    if (!isLoaded) {
        cy.log('Notes page not loaded properly, skipping test');
        notesPage.takeScreenshot('notes-not-loaded');
        return;
    }
    // Test empty form submission
    notesPage.clickAddNote();
    notesPage.submitNoteForm();
    cy.get('[data-testid="form-error"]').should('be.visible');
    // Test duplicate title error
    cy.intercept('POST', '/api/users/notes', {
        statusCode: 409,
        body: { error: 'Note with this title already exists' }
    }).as('createDuplicateNote');
    notesPage.fillNoteForm({
        title: 'Duplicate Note',
        content: 'This should fail'
    });
    notesPage.submitNoteForm();
    cy.wait('@createDuplicateNote');
    notesPage.verifyErrorNotification();
});

// Check if notes page loaded properly
notesPage.isNotesPageLoaded().then(function (isLoaded) {
    if (!isLoaded) {
        cy.log('Notes page not loaded properly, skipping test');
        notesPage.takeScreenshot('notes-not-loaded');
        return;
    }
    // Create multiple notes with different tags
    var notes = [
        { title: "Note A ".concat(Date.now()), content: 'Content A', tags: ['work', 'important'] },
        { title: "Note B ".concat(Date.now()), content: 'Content B', tags: ['personal'] },
        { title: "Note C ".concat(Date.now()), content: 'Content C', tags: ['work'] }
    ];
    notes.forEach(function (note) {
        notesPage.clickAddNote();
        notesPage.fillNoteForm(note);
        notesPage.submitNoteForm();
        cy.wait('@createNote');
        notesPage.verifySuccessNotification();
    });
    // Test tag filtering
    notesPage.filterByTag('work');
    cy.wait('@getNotes');
    notesPage.noteExists(notes[0].title).then(function (exists) {
        cy.wrap(exists).should('be.true');
    });
    notesPage.noteExists(notes[1].title).then(function (exists) {
        cy.wrap(exists).should('be.false');
    });
    notesPage.noteExists(notes[2].title).then(function (exists) {
        cy.wrap(exists).should('be.true');
    });
    // Test search functionality
    notesPage.searchNotes('Content B');
    cy.wait('@getNotes');
    notesPage.noteExists(notes[1].title).then(function (exists) {
        cy.wrap(exists).should('be.true');
    });
    notesPage.noteExists(notes[0].title).then(function (exists) {
        cy.wrap(exists).should('be.false');
    });
});

// Check if notes page loaded properly
notesPage.isNotesPageLoaded().then(function (isLoaded) {
    if (!isLoaded) {
        cy.log('Notes page not loaded properly, skipping test');
        notesPage.takeScreenshot('notes-not-loaded');
        return;
    }
    // Test API failure
    cy.intercept('POST', '/api/users/notes', {
        statusCode: 500,
        body: { error: 'Internal server error' }
    }).as('createNoteError');
    notesPage.clickAddNote();
    notesPage.fillNoteForm({
        title: 'Network Error Test',
        content: 'This should fail'
    });
    notesPage.submitNoteForm();
    cy.wait('@createNoteError');
    notesPage.verifyErrorNotification();
});
